import javax.sound.sampled.*;
import java.io.IOException;
import java.io.InputStream;
import java.io.OutputStream;
import java.net.Socket;
import java.util.Scanner;

public class Client {
    private static final String SERVER_ADDRESS = "0.0.0.0";
    private static final int SERVER_PORT = 5555;


    public static void main(String[] args) {
        AudioFormat format = new AudioFormat(44100, 16, 1, true, true);
        DataLine.Info targetInfo = new DataLine.Info(TargetDataLine.class, format);
        DataLine.Info sourceInfo = new DataLine.Info(SourceDataLine.class, format);
        Scanner sc = new Scanner(System.in);

        Thread soundSenderThread = null;
        Thread soundReceiverThread = null;

        try (Socket socket = new Socket(SERVER_ADDRESS, SERVER_PORT)) {
            System.out.println("Connected to server: " + socket.getInetAddress());

            while (sc.hasNextLine()) {
                String commandOrMessage = sc.nextLine();
                switch (commandOrMessage) {
                    case ("C"):
                        TargetDataLine targetLine = (TargetDataLine) AudioSystem.getLine(targetInfo);
                        SourceDataLine sourceLine = (SourceDataLine) AudioSystem.getLine(sourceInfo);

                        targetLine.open(format);
                        sourceLine.open(format);

                        targetLine.start();
                        sourceLine.start();

                        soundSenderThread = new Thread(new SoundSender(targetLine, socket));
                        soundReceiverThread = new Thread(new SoundReceiver(sourceLine, socket));
                        soundSenderThread.start();
                        soundReceiverThread.start();
                        break;
                    case ("D"):
                        if (soundSenderThread != null) {
                            soundSenderThread.interrupt();
                            soundReceiverThread.interrupt();
                            break;
                        } else {
                            System.out.println("Not connected");
                            break;
                        }
                    case ("Q"):
                        System.exit(0);
                }
            }

        } catch (LineUnavailableException e) {
            e.printStackTrace();
        } catch (IOException e) {
            System.out.println("Connection error");
        }
    }


    private static class SoundSender implements Runnable {
        private final TargetDataLine targetLine;
        private final Socket socket;

        public SoundSender(TargetDataLine targetLine, Socket socket) {
            this.targetLine = targetLine;
            this.socket = socket;
        }

        @Override
        public void run() {
            try (OutputStream output = socket.getOutputStream()) {
                byte[] buffer = new byte[1024];
                int bytesRead;
                while ((bytesRead = targetLine.read(buffer, 0, buffer.length)) != -1) {
                    if (!socket.isClosed()) {
                        output.write(buffer, 0, bytesRead);
                    }
                }
            } catch (IOException e) {
                e.printStackTrace();
            } finally {
                System.out.println("Sender closed");
            }
        }
    }

    private static class SoundReceiver implements Runnable {
        private final Socket socket;
        private final SourceDataLine sourceLine;

        public SoundReceiver(SourceDataLine sourceLine, Socket socket) {
            this.socket = socket;
            this.sourceLine = sourceLine;
        }


        @Override
        public void run() {
            try (InputStream input = socket.getInputStream()){
                byte[] buffer = new byte[1024];
                int bytesRead;
                while ((bytesRead = input.read(buffer)) != -1) {
                    if (!socket.isClosed()) {
                        sourceLine.write(buffer, 0, bytesRead);
                    } else {
                        break;
                    }
                }
            } catch (IOException e) {
                e.printStackTrace();
            } finally {
                System.out.println("Receiver closed");
            }
        }
    }
}

